{%1=What are installments}
A payment method that allows customers to make purchases now and pay for them in four payments made every two weeks with 2 percent interest.

{%2=How does the payment schedule work}
Customers are required to make their first payment at the time of purchase. The remaining three payments are then charged automatically to your selected payment method every two weeks in installments.

{%3=Can I get refunds when paying with installments}
Yes. You can get refunded for the amount that you have paid. Any amount that is left due will no longer be charged.

{%4=Is there a limit to how much I can spend using installments}
Customers are allowed a maximum of $50 to use towards installments. This overall, not per transaction. Any dollar amount not covered by installments are added to the overall total. You will have more dollars to use towards your installments as you pay off previous installments.

{%5=Is there a minimum order total to use installments}
Installments are only available for transactions above $10.00.

{%6=Is there interest}
Yes. You will be charged 2 percent interest on the balance of your installments.
